CREATE TABLE android_metadata (locale TEXT);
CREATE TABLE Packages (packageName TEXT NOT NULL PRIMARY KEY, version INTEGER NOT NULL, params BLOB, dynamicParams BLOB, weak INTEGER NOT NULL, androidPackageName TEXT NOT NULL, isSynced INTEGER, serializedDeclarativeRegInfo BLOB DEFAULT NULL, configTier INTEGER DEFAULT NULL, baselineCl INTEGER DEFAULT NULL);
CREATE TABLE ApplicationStates (packageName TEXT NOT NULL PRIMARY KEY, user TEXT NOT NULL, version INTEGER NOT NULL, patchable INTEGER);
CREATE TABLE MultiCommitApplicationStates (packageName TEXT NOT NULL, user TEXT NOT NULL, version INTEGER NOT NULL, PRIMARY KEY(packageName, user));
CREATE TABLE LogSources (logSourceName TEXT NOT NULL, packageName TEXT NOT NULL, PRIMARY KEY(logSourceName, packageName));
CREATE TABLE WeakExperimentIds (packageName TEXT NOT NULL, experimentId INTEGER NOT NULL);
CREATE TABLE ExperimentTokens (packageName TEXT NOT NULL, version INTEGER NOT NULL, user TEXT NOT NULL, isCommitted INTEGER NOT NULL, experimentToken BLOB NOT NULL, serverToken TEXT NOT NULL, configHash TEXT NOT NULL DEFAULT '', servingVersion INTEGER NOT NULL DEFAULT 0, tokensTag BLOB DEFAULT NULL, flagsHash INTEGER DEFAULT NULL, PRIMARY KEY(packageName, version, user, isCommitted));
CREATE TABLE Flags (packageName TEXT NOT NULL, version INTEGER NOT NULL, flagType INTEGER NOT NULL, partitionId INTEGER NOT NULL, user TEXT NOT NULL, name TEXT NOT NULL, intVal INTEGER, boolVal INTEGER, floatVal REAL, stringVal TEXT, extensionVal BLOB, committed INTEGER NOT NULL, PRIMARY KEY(packageName, version, flagType, partitionId, user, name, committed));
CREATE TABLE RequestTags (user TEXT NOT NULL PRIMARY KEY, bytesTag BLOB NOT NULL);
CREATE TABLE ApplicationTags (packageName TEXT NOT NULL, version INTEGER NOT NULL, partitionId INTEGER NOT NULL, user TEXT NOT NULL, tag BLOB NOT NULL, PRIMARY KEY(packageName, version, partitionId, user));
CREATE TABLE CrossLoggedExperimentTokens (fromPackageName TEXT NOT NULL, fromVersion INTEGER NOT NULL, fromUser TEXT NOT NULL, toPackageName TEXT NOT NULL, toVersion INTEGER NOT NULL, isCommitted INTEGER NOT NULL, token BLOB NOT NULL, provenance INTEGER NOT NULL);
CREATE TABLE ChangeCounts (packageName TEXT NOT NULL PRIMARY KEY, count INTEGER NOT NULL);
CREATE TABLE DogfoodsToken (key INTEGER NOT NULL PRIMARY KEY, token BLOB);
CREATE TABLE LastFetch (key INTEGER NOT NULL PRIMARY KEY, servertimestamp INTEGER NOT NULL);
CREATE TABLE FlagOverrides (packageName TEXT NOT NULL, user TEXT NOT NULL, name TEXT NOT NULL, flagType INTEGER NOT NULL, intVal INTEGER, boolVal INTEGER, floatVal REAL, stringVal TEXT, extensionVal BLOB, committed, PRIMARY KEY(packageName, user, name, committed));
CREATE TABLE GenericDimensions (packageName TEXT NOT NULL, isolationkey TEXT NOT NULL DEFAULT '', namespace INTEGER NOT NULL, instance INTEGER NOT NULL);
CREATE TABLE LastSyncAfterRequest (packageName TEXT NOT NULL PRIMARY KEY, servingVersion INTEGER NOT NULL DEFAULT 0);
CREATE INDEX androidPackageName ON Packages (androidPackageName);
CREATE INDEX packageName ON LogSources (packageName);
CREATE INDEX committed ON ExperimentTokens (packageName, version, user, isCommitted);
CREATE INDEX apply ON CrossLoggedExperimentTokens (fromPackageName, fromVersion, fromUser, toPackageName, toVersion, isCommitted);
CREATE INDEX remove ON CrossLoggedExperimentTokens (toPackageName);
CREATE INDEX configPackageIsolationKey ON GenericDimensions (packageName, isolationkey);